import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import HorizontalScroll from "../../../common/HorizontalScroll";
import { artistActions } from "../../../../state/actions";
import { Box } from "@mui/system";
import { Avatar, Stack } from "@mui/material";
import { deepOrange, green, red } from "@mui/material/colors";

const Rappers = () => {
  const artistType = "rappers";
  const dispatch = useDispatch();
  dispatch(artistActions.currentArtistType(artistType));

  const titles = ["OG", "Upcoming"];
  const artists = useSelector((state) => state.artist.artists);

  useEffect(() => {
    try {
      dispatch(artistActions.artistsInfo(artistType, titles));
    } catch (error) {
      console.log("error is " + error.message);
    }
  }, []);

  return (
    // <div style={{ backgroundColor: "#272727" }}>
    <div>
      <Box sx={{ display: "flex" }}>
        <Box>
          <Stack direction="column" spacing={2} sx={{ m: 1 }}>
            <Avatar
              className="ripple"
              onClick={() => console.log("clicked")}
              sx={{
                m: "auto",
                width: 100,
                height: 100,
                bgcolor: red["A700"],
              }}
            >
              OG
            </Avatar>
            <Avatar
              className="ripple"
              onClick={() => console.log("clicked")}
              sx={{
                m: "auto",
                width: 100,
                height: 100,
                bgcolor: red["#2e95bd"],
              }}
            >
              Legend
            </Avatar>
            <Avatar
              className="ripple"
              onClick={() => console.log("clicked")}
              sx={{ m: "auto", width: 100, height: 100 }}
            >
              UnderDog
            </Avatar>
            <Avatar
              className="ripple"
              onClick={() => console.log("clicked")}
              sx={{ m: "auto", width: 100, height: 100 }}
            >
              Upcoming
            </Avatar>
            <Avatar
              className="ripple"
              onClick={() => console.log("clicked")}
              sx={{ m: "auto", width: 100, height: 100 }}
            >
              OG
            </Avatar>
          </Stack>
        </Box>
        <Box>
          <Box sx={{ display: "flex" }}>
            <Box>1</Box>
            <Box sx={{ display: "flex" }}>
              <Box>2</Box>
              <Box>2</Box>
              <Box>2</Box>
              <Box>2</Box>
            </Box>
          </Box>
        </Box>
      </Box>
      {/* {artists !== null &&
        artists.map((horizontalScroll, i) => (
          <HorizontalScroll
            key={i}
            horizontalScroll={horizontalScroll}
            title={titles[i]}
          ></HorizontalScroll>
        ))} */}
    </div>
  );
};
export default Rappers;
